{"5": ["Пришла только подставка. Мисок как заявлено в описании нет!!!! Уважаемые владельцы этого магазина, верните либо деньги, либо миски пришлите!!! Отвратительно!! Как вы формируете заказ??? Да еще при 100% предоплате!!!", "2020-07-02T12:55:42.338209321Z", "серебристый", "0", 5, 4, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "7": ["Отказ! По той причине что товар не соответствует размеру. Заказывали на 350 мл, пришел на 100 мл. И цене было бы дешевле. . Прошу не вычитывать процент выкупа", "2020-07-27T07:29:11.478180898Z", "серебристый", "0", 1, 0, 2, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "8": ["Это на самом деле прикол, заказываешь 2 миски на подставке, а приходит только подставка! Ребята по дороге себе миски забирают и продают их отдельно что ли?", "2020-07-18T15:52:32.309695289Z", "серебристый", "0", 3, 0, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "10": ["Очень маленькие миски. Брали для дачи для щенка далматина, но это совсем не подходит( Не знаю зачем оставила( только для кота или совсем маленькой собачки. Размеры не посмотрела, моя вина. Миски вообще хорошие. ", "2020-07-11T04:19:17.77968496Z", "серебристый", "0", 3, 0, 5, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "11": ["Неплохие. Но проверяйте комплектность. Мне первый раз пришли без мисок, только рамка.", "2020-07-09T09:11:40.551561172Z", "серебристый", "0", 1, 0, 4, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "14": ["Хорошие мисочки, но на одной ножке подставки не было резиночки (против скольжения). Очень понравились мисочки, поэтому забрали, не стали возврат делать.", "2020-07-04T12:47:21.469145528Z", "серебристый", "0", 1, 0, 4, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "15": ["не было возврата денег!", "2020-07-03T12:21:58.09274738Z", "серебристый", "0", 1, 0, 5, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "16": ["Получила, всё в комплекте. Брала для кошечек, но спокойно подойдёт и для кормления собак средних размеров", "2020-06-28T13:17:51.712320178Z", "серебристый", "0", 1, 0, 5, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "17": ["Пришла подставка без мисок..что то последнее время товар ужасный приходит, либо что то нарушено, либо не доложили (((Разочаровыете", "2020-06-28T08:16:31.55035112Z", "серебристый", "0", 2, 1, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "18": ["Пришла только подставка, без мисок. Поэтому отказ.", "2020-06-28T07:42:29.806068219Z", "серебристый", "0", 2, 1, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "19": ["С нетерпением ждали миски для нашего котёнка. По размеру и высоте были бы идеально, но! Пришла только ОДНА миска! Полное разочарование! Ждать новую долго. Проще уже в зоомагазин сходить и купить. В общем сервис вайлдбериз начал хромать все сильнее....", "2020-06-26T17:06:36.339294249Z", "серебристый", "0", 4, 0, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "20": ["На одной ножке не было чёрной ножки\nОтказ", "2020-06-22T14:18:09.421541945Z", "серебристый", "0", 3, 0, 5, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "21": ["Миски маленькие, для мелкой собачки или кошки. На двух ножках отсутствовали пластиковые насадки - отказ", "2020-06-22T12:14:55.877980951Z", "серебристый", "0", 2, 0, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "22": ["Пришла без одной ножки,возврат!прошу не снимать процент выкупа", "2020-06-21T18:11:06.439345166Z", "серебристый", "0", 2, 0, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "23": ["Пришла без одной миски, прошу не снимать процент выкупа.", "2020-06-20T11:01:50.007218432Z", "серебристый", "0", 3, 1, 1, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "24": ["Пришла без 1-ой черной ножки. Прикрутили изоленту.", "2020-06-02T10:46:56.159878023Z", "серебристый", "0", 1, 0, 4, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"], "27": ["Пришёл набор только с 1 миской. Миска объёмом не более 250гр.", "2020-04-28T12:56:37.300421955Z", "серебристый", "0", 1, 0, 4, "Набор из 2 мисок на подставке, 2 х 350 мл", "MAMA RAMA"]}
